// import PersonalAc from "../../Pages/Profile"
const Navbar = ({ user }) => {
    const Logout = () => {
        window.open(`${process.env.REACT_APP_REDIRECT}/auth/logout`, "_self")
    }

    function GetUser(user){
    }

    return(
        <ul className="list">
            <span className="logo">
                <Link className="link" to="/">
                    Twitch Revels
                </Link>
            </span>
            <GetUsser isGetUser={user}/>
        </ul>
    )
}

export default Navbar;
